import React from "react";
import "../cssFile/EachLine.css";
export default function EachLine(props) {
  console.log(props.e.orderId);
  return (
    <li style={{display:"flex",margin:"5px"}} className="list-group-item">
      <div id="photoDiv">
        <img id="imgOrder" src={props.e.srcImg} />
      </div>
      <div id="">
        <p id="orderIdText">Order Id : {props.e.orderId}</p>
        <p id="orderPriceText">Total Price : {props.e.totalPrice}$</p>
      </div>
    </li>
  );
}
